import React from "react";

function Form(props) {
  console.log(props)
  return (
    <form className="form">
      <input type="text" placeholder="Username" />
      <input type="password" placeholder="Password" />
      <Confirm 
        userIsRegistered = {props.userIsRegistered}
      />
      <button type="submit">
        {props.userIsRegistered ? "Login" : "Register"}
      </button>
    </form>
  );
}

export default Form;
